import React from 'react'; 
import ReactDOM from 'react-dom';
import jsPDF from 'jspdf'
import ImageValue from './image.js'

export default class Confirm extends React.Component{

    constructor(props){
        super(props);
    }
      

    render(){
        var img = 'data:image/jpeg;base64,';
        var imgData = img;
        var doc = new jsPDF('landscape');
                
        doc.addImage(imgData, 'JPEG', 0, 0, 297, 210);

        //left side paremeters
        doc.setFont('courier')
        doc.setFontSize(16);
        doc.text(210, 80,  "JABARI");

        //left side paremeters
        doc.setFont('courier')
        doc.setFontSize(16);
        doc.text(60, 100, this.props.summary.name);

        doc.setFont('courier')
        doc.setFontSize(16);
        doc.text(86, 110, "31/07/89");

        doc.setFont('courier')
        doc.setFontSize(16);
        doc.text(103, 120, "Joseph Kimbowa Lutaaya");

        doc.setFont('courier')
        doc.setFontSize(16);
        doc.text(103, 130, "Gertrude Kateesa");

        doc.setFont('courier')
        doc.setFontSize(16);
        doc.text(103, 140, "YMU-9267903");

        //right side parameters
        doc.setFont('courier')
        doc.setFontSize(16);
        doc.text(180, 100, "Male");

        doc.setFont('courier')
        doc.setFontSize(16);
        doc.text(220, 110, "Mlima, Jabari");

        var val = doc.output('dataurlstring', {});


        return(
            <div id="welcome" class="welcome">
                <h1 class="text-center" id="welcome-title">welcome home</h1>
                <h3 class="text-center">Confirm your information</h3>
                <div class="row">
                    <div class="col-md-12 wrapper">
                        <ul role="menu">
                                <li>{this.props.summary.name}</li>
                                <li>{this.props.summary.dob.toString()}</li>
                                <li>{this.props.summary.tribe}</li>
                        </ul>              
                        <button class="btn btn-default btn-strong" type="button" id="startbutton">Proceed</button>
                    </div>
                    <div class="col-md-12 wrapper">
                        <iframe  width="100%" height="600px" type="application/pdf" src={val}></iframe>
                    </div>                   
                </div>
            </div>
        );
    }
}


